<!DOCTYPE html>
<html>
<head>
	<title>Nested list</title>
</head>
<body>
	<ul>
		<li>AAAAAAAAAAAA</li>
		<li>BBBBBBBBBBBB</li>
		<ol>
			<li>CCCCCCCCCCC</li>
			<li>DDDDDDDDDDD</li>
			<li>EEEEEEEEEEE</li>
		</ol>
	</ul>
	<ul>
		<li>FFFFFFFFFFFF</li>
		<li>GGGGGGGGGGGG</li>
		<ol>
			<li>HHHHHHHHHHHH</li>
			<li>IIIIIIIIIIII</li>
			<ol type="I">
                  <li>JJJJJJJJ</li>
                  <li>KKKKKKKKKKKKK</li>
                  <li>LLLLLLLLLLLL</li>
		    </ol>

		</ol>
	</ul>

</body>
</html>
